INSERT INTO `posts` (`id`, `title`, `content`, `thumbnail`, `author_id`, `created_at`, `updated_at`, `status`) VALUES
(10, 'BÁNH BÔNG CẢI XANH Demo', '<p><strong class=\"ql-size-large\">BÁNH BÔNG CẢI XANH Demo</strong></p><p><strong>Chuẩn bị: </strong>15 phút </p><p><strong>Nấu: </strong>1 giờ 25 phút</p><p><strong>Khẩu phần: </strong>4 người</p><p><br></p><p>❗️❗️❗️<span style=\"color: rgb(230, 0, 0);\">&nbsp;THÀNH PHẦN GÂY DỊ ỨNG&nbsp;❗️❗️❗️</span></p><p><span style=\"color: rgb(230, 0, 0);\">Công thức có thể chứa men, sulfit, gluten, lúa mì và trứng.</span></p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"Bánh bông cải xanh chay\" height=\"321\" width=\"481\"></p><p><em>Bông cải xanh cực kỳ bổ dưỡng đóng vai trò trung tâm trong những chiếc bánh rán lành mạnh này, được phục vụ kèm roti, salad xanh và sữa chua.</em></p><p><br></p><p>Nguyên liệu (17)</p><ul><li>350g bông cải cắt nhỏ</li><li>1 chén đậu tằm (broad beans) đông lạnh, rã đông và bóc vỏ</li><li>1 tép tỏi, đập dập</li><li>3 cây hành lá, cắt nhỏ</li><li>2 muỗng canh lá bạc hà tươi băm nhỏ, thêm vài nhánh để trang trí</li><li>1 chén bột đậu gà (xem ghi chú)</li><li>½ thìa cà phê bột nở</li><li>1 thìa cà phê bột thì là xay</li><li>1 thìa cà phê bột ngò xay</li><li>1 quả trứng, đánh nhẹ</li><li>¼ chén dầu thực vật</li><li>4 quả dưa leo baby, thái lát mỏng</li><li>Roti nóng, để ăn kèm</li><li>Lá xà lách, để ăn kèm</li><li><strong>Sốt sữa chua xanh:</strong></li><li>½ chén sữa chua Hy Lạp không đường</li><li>1 chén lá bạc hà tươi</li><li>1 thìa cà phê nước cốt chanh</li></ul><p>Quy trình</p><p><strong>Bước 1</strong></p><p>– Cho 350 g bông cải xanh, 150 g đậu tằm, 2 tép tỏi, ½ củ hành tây và 1 nắm húng lủi vào máy xay thực phẩm. Nhấn, nhồi cho đến khi nguyên liệu được băm nhuyễn.</p><p>– Trong một tô lớn, trộn đều 1 chén (khoảng 125 g) bột mì, 1 muỗng cà phê bột nở, 1 muỗng cà phê thì là xay và 1 muỗng cà phê hạt ngò xay. Nêm ½ muỗng cà phê muối và chút tiêu.</p><p>– Tạo một “giếng” ở giữa hỗn hợp bột, đập vào 1 quả trứng và đổ ⅔ chén (≈160 ml) nước. Dùng phới lồng đánh đến khi bột mịn, không vón cục.</p><p>– Cho hỗn hợp bông cải đã xay vào tô bột, trộn đều cho đến khi quyện hẳn.</p><p><strong>Bước 2</strong></p><p>– Đun nóng dầu ăn trong chảo chống dính ở lửa vừa.</p><p>– Múc mỗi lần ¼ chén (≈60 ml) hỗn hợp bột cho lên chảo, nhẹ nhàng nén dẹt thành miếng tròn đường kính khoảng 6 cm. Làm lần lượt 3 miếng rồi rán mỗi mặt khoảng 2 phút hoặc đến khi vàng đều và chín.</p><p>– Vớt ra giấy thấm dầu. Tiếp tục rán phần bột còn lại để được tổng cộng 12 chiếc fritters.</p><p><strong>Bước 3</strong></p><p>– Trong khi chờ, làm “sữa chua xanh”: cho 200 g sữa chua không đường, 1 nắm húng lủi và 1 muỗng canh nước cốt chanh vào máy xay nhỏ. Xay đến khi hỗn hợp mịn, có màu xanh nhạt. Nêm ¼ muỗng cà phê muối và chút tiêu cho vừa ăn.</p><p><strong>Bước 4</strong></p><p>– Bày bánh bông cải xanh ra đĩa, rưới hoặc chấm kèm sữa chua xanh. Thêm dưa leo thái lát, roti (hoặc bánh mì), và rau salad theo ý thích. Trang trí thêm lá húng tươi trước khi thưởng thức.</p><p><strong>Recipe notes</strong></p><p>Make-ahead tips:</p><p>- Để đông: bọc giấy nến và màng bọc rồi đông lạnh.</p><p>- Rã đông: để ngăn mát 24h.</p><p>- Hâm nóng: nướng lại như hướng dẫn.</p>', 'https://images2.thanhnien.vn/528068263637045248/2024/1/25/e093e9cfc9027d6a142358d24d2ee350-65a11ac2af785880-17061562929701875684912.jpg', 1, '2025-07-12 23:49:08', '2025-07-31 00:06:01', 0),
(11, ',zjbda,s', '<p>lsdhl</p>', 'https://images2.thanhnien.vn/528068263637045248/2024/1/25/e093e9cfc9027d6a142358d24d2ee350-65a11ac2af785880-17061562929701875684912.jpg', 1, '2025-07-13 00:00:44', '2025-07-31 00:05:58', 0);
